use db_27_2;

create table Attendance_Master_27(
att_id int auto_increment primary key,
date_of_att date,
std_id int,
attendance varchar(1),
FOREIGN KEY (std_id) REFERENCES Student_Master_27(std_id));

select * from Attendance_Master_27;

select count(std_id), attendance from Attendance_Master_27 where attendance = '1' and date_of_att between '2023-12-01' and '2023-12-31' ;

-- How many times Student 1 is present in December 
select std_id, attendance from Attendance_Master_27 where attendance = '1' and date_of_att between '2023-12-01' and '2023-12-31';

-- How many times Student 1 is present in January 
select count(std_id), attendance from Attendance_Master_27 where attendance = '1' and std_id = 1 and date_of_att between '2024-01-01' and '2024-01-31';

-- How many students are present in each day
select std_id, count(attendance) from Attendance_Master_27 where attendance = '1' and date_of_att between '2024-01-01' and '2024-01-31' group by std_id;

select Student_Master_27.std_id, first_name, count(attendance) as Present_In_Dec, count(Student_Master_27.std_id) div 0.31 as Percentage from Student_Master_27 
inner join Attendance_Master_27 on Student_Master_27.std_id = Attendance_Master_27.std_id 
where attendance = '1' and date_of_att between '2023-12-01' and '2023-12-31' group by std_id order by std_id;

select std_id, first_name, count(attendance) as PresentInjan from Attendance_Master_27 left join Student_Master_27 on Attendance_Master_27.std_id = Student_Master_27.std_id where attendance = '1' and date_of_att between '2024-01-01' and '2024-01-31' group by std_id;

-- How many times Student 1 is present in February 
select count(std_id), attendance from Attendance_Master_27 where attendance = '1' and std_id = 1 and date_of_att between '2024-02-01' and '2024-02-29';

-- How many times Student 1 is present in December, January, February 
select count(std_id), attendance from Attendance_Master_27 where attendance = '1' and std_id = 1 and date_of_att between '2023-12-01' and '2024-02-29';





























































































